import parseLink from './parseLink';

export default (link, path) => {
  const url = parseLink(link);
  const asPath = parseLink(path);
  const comparedLink = asPath.pathname ? asPath.pathname : asPath.split('?')[0];
  return comparedLink.replace(/\/$/, '') === url.pathname.replace(/\/$/, '');
};
